import React from 'react';
import { HashRouter as Router, Route, withRouter, Switch } from 'react-router-dom';
import './home.scss';
import MenuCom from './menu';
import Patient from '../patient/patient';
import Appointment from '../appointment/appointment';
import MainLayout from '../layout/MainLayout';
const Patients =() => (
  <Router>
    <Patient/>
  </Router>
)
const Appointments =() => (
  <Router>
    <Appointment/>
  </Router>
)
class Home extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
    };
  }
  render() {
    return (
      <div className="home">
        <MenuCom/>
        <div className="home-header">

        </div>
        <div className="home-main">
          <Router>
            <Switch>
              <Route path="/home" component={
                <MainLayout>

                </MainLayout>
              }></Route>
              <Route exact path="/home/" component = { Patients } ></Route>
              <Route exact path="/home/patient" component = { Patients } ></Route>
              <Route path="/home/appointment" component = { Appointments } ></Route>
            </Switch>
          </Router>
        </div>
      </div>
    );
  }
}

export default withRouter(Home);
